import React from "react";
// import "./Profile.css";

interface ProfileProps {
  name: string;
  title: string;
  email: string;
  phone: string;
  linkedIn: string;
  summary: string;
}

const Profile: React.FC<ProfileProps> = ({
  name,
  title,
  email,
  phone,
  linkedIn,
  summary,
}) => {
  return (
    <div className="resume">
      <div className="header">
        <h1>{name}</h1>
        <h2>{title}</h2>
          <small>Email: {email}</small><br/>
          <small>Phone: {phone}</small><br/>
          <small>LinkedIn: {linkedIn}</small><br/>
      </div>
      <div className="summary">
        <h3>Summary</h3>
        <p>{summary}</p>
      </div>
      {/* Add more sections for experience, education, skills, etc. */}
    </div>
  );
};

export default Profile;
